script: |
  super -f text -I q9077.spq | sort > q9077.out

inputs:
  - name: q9077.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( NULL ) BETWEEN + col0 / 44 + + CAST ( NULL AS INTEGER ) - - + 41 * ( + col1 ) AND 45;
  - name: tab2

outputs:
  - name: q9077.out
    data: |
